import React from "react";
import "../../App.css";
import Footer from "../Footer";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";

import ScrollToTop from "react-scroll-up";

const responsive = {
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3,
    paritialVisibilityGutter: 60,
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2,
    paritialVisibilityGutter: 50,
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1,
    paritialVisibilityGutter: 30,
  },
};
const images = [
  "/imgservices/services-1.jpg",
  "/imgservices/services-2.jpg",
  "/imgservices/services-3.jpg",
  "/imgservices/services-4.jpg",
  "/imgservices/services-5.jpg",
  "/imgservices/services-6.jpg",
  "/imgservices/services-7.jpg",
  "/imgservices/services-8.jpg",
  "/imgservices/services-9.jpg",
  "/imgservices/services-10.jpg",
  "/imgservices/services-11.jpg",
  "/imgservices/services-12.jpg",
  "/imgservices/services-13.jpg",
  "/imgservices/services-14.jpg",
  "/imgservices/services-15.jpg",
  "/imgservices/services-16.jpg",
];
export default function Services() {
  let sliceimg = images.map(function (data, i) {
    return (
      <div style={{ margin: "0 10px" }}>
        <img src={data} alt="" width="100%" height="auto" />
      </div>
    );
  });
  return (
    <>
      <div className="hero-img-container">
        <div className="hero-containers" style={{ padding: "50px 50px" }}>
          <Carousel
            ssr
            partialVisbile
            itemClass="image-item"
            responsive={responsive}
            autoPlaySpeed={3000}
            autoPlay={true}
            infinite
          >
            {sliceimg}
          </Carousel>
        </div>
      </div>
      <ScrollToTop showUnder={160}>
        <span>
          <img src="/img-960px/up_arrow_round.png" alt="" />
        </span>
      </ScrollToTop>

      <Footer />
    </>
  );
}
